IQ Boost is a game with tricky puzzles, tasks and logic tests. 
All the tasks are original and funny! We said ‘NO’ to boring brain training.
Free IQ Boost game features only the best tasks, brainteasers and exercises to train your memory, attention, logic and mindset. 

Only 10% of all the people have an IQ higher than 120. Are you among them? Play IQ Boost - challenge your brain.

Try yourself in solving nontrivial tasks. You will train logical and abstract thinking by solving puzzles and logic tasks. Сoncentration and memory will be better too. 
Have a good time while training your brain. 

Find out your IQ level. Lower than you thought? Play IQ Boost and you’ll see your IQ is growing. 

Game features:
• Easy to play;
• Nonstandard colourful gameplay;
• Funny answers and solutions;
• Nontrivial challenges for any age;
• Lots of levels;
• Intellectual brain-teaser game.

Remember: obvious solutions might not be not always right...think out of the box and train your brain! Play and prove you are the cleverest!

Draw to Home is a casual puzzle game. You need to help villains find their way to home, draw a line between the villains and their corresponding houses, and avoid the villains from bumping into each other. If they collide, they will be dizzy and the game will fail. To avoid all kinds of obstacles, let all the villains get home safely to win the game.

How to play:
1. Click on the leg of the villain to start drawing lines;
2. Avoid the collision of 2 villains;
3. Pay attention to avoid wooden boxes, lifting columns, cars, and thieves;
4. The rational use of Hercules will make customs clearance easier;
5. Try to collect all the diamonds;
6. Make sure all the villains get home safely and win the game.

Game Features:
1. Rich and interesting levels;
2. Various customs clearance methods;
3. Fully exercise the ability to solve puzzles;
4. Funny characters.

Welcome to try our game, if you have any comments on the game, you can give feedback in the game, thank you for your participation.

Introducing MultiCraft ― world of unlimited opportunities! Get ready for real Adventures!

Build and Destroy Blocks. Get Resources and Create Various Tools, Blocks and Weapons with which you can Survive and create unique Buildings.

Choose your side in this world ― a Builder (Creative mode) or a Ruthless Hunter, who will do everything to stay alive (Survival mode)!

► Be careful, in this world not only peaceful Animals, but an awful Monsters too! Win a battle with them and you will get priceless resources!
► Swim across the seas for new lands and resources ― lands are unlimited. Exploration them!
► If you decided to Survive ― keep eye on hunger and fill out it in time! Search for food, grow plants and kill mobs for meat!
► Built your shelter from the monsters and you will survive this night! They are coming for you… Zombies, Skeletons, Huge Spiders and other hostile mobs.
► At any time you can fly to the skies with the «Fly» mode or become fast as flash with the «Fast» mode.
► You can save your Home Point, create Waypoints, and change the Time of Day. Play by your own rules, because it's your own world!

In this game your actions are unlimited only by your imagination! The game does not require any skills ― you can at all understand in the first minutes of the game. With MultiCraft you can spend good time everywhere and every time! And it’s totally FREE!

Do you want to play with your friends? Join one of the many custom servers («Multiplayer» tab) or create your own («Host Server» tab) for free. The game has a constantly updated list of various servers. You're sure to find one you like!

